import React from "react";
import styled from "styled-components";

const Nav = styled.div`
  width: 100vw;
  height: 10vh;
  position: relative;

  background-color: #282828;
`;

function NavigationBar() {
  return (
    <Nav>
      <div>NavigationBar</div>
    </Nav>
  );
}

export default NavigationBar;
